We will use Visual Studio Code to create IOU smart contract model. Go to the folder called "iou" in your iou_tutorial folder created in the previous page mkdir iou Copy following package metadata and save it as package.json in your iou folder { "engines": { "composer": "^0.19.0" }, "name": "iou", "version": "0.0.1", "description": "IOU network"
} Create a models folder called "models" inside the top level "iou" folder cd iou
mkdir models Copy following resource definitions and save it as iou.cto in your models folder namespace com.example.iou import com.tibco.dovetail.system.* asset IOU identified by linearId extends LinearState { --> Party issuer --> Party owner o Amount amt o Amount paid
} /*
@InitiatedBy - arg0: comma delimited list of authorized participants in the format of $tx.path.to.participant, or * for any participant - arg1: optional, comma delimited list of required attributes that must exist in the initiator's certificate in the format of name=value.
*/
@InitiatedBy("$tx.iou.issuer")
transaction IssueIOU { o IOU iou
} @InitiatedBy("$tx.iou.owner")
transaction TransferIOU { --> IOU iou //by reference because the asset is already on the ledger --> Party newOwner
} @InitiatedBy("$tx.iou.owner")
transaction SettleIOU { --> IOU iou --> Cash[] funds o Amount payAmt --> Party sendChangeTo --> Party sendPaymentTo
} /* @Query : mark transaction as query only
*/
@Query()
transaction getIOU { o String linearId
} @Query()
transaction getIOUIssuedBy { o String issuerPartyId
} Copy following resource definitions and save it as dovetail.system.cto in your models folder namespace com.tibco.dovetail.system /*
for Hyperledger Fabric, id is the member's mspId
for Corda, id is the member's cert name
*/
participant Party identified by id { o String id
} abstract asset State {
}
/*
All non-fungible asset should inherit from LinearState
*/
@CordaClass("net.corda.core.contracts.LinearState")
abstract asset LinearState extends State { o String linearId
} @CordaClass("net.corda.core.contracts.FungibleAsset")
abstract asset FungibleAsset extends State{ o Amount amt --> Party issuer o String issuerRef --> Party owner
} @CordaClass("net.corda.finance.contracts.asset.Cash.State")
asset Cash identified by assetId extends FungibleAsset { o String assetId
} @CordaClass("net.corda.core.contracts.Amount<Currency>")
concept Amount { o String currency o Long quantity default = 0
} Run zip command from iou directory to package the iou project, it will create a iou.bna file in the tutorial folder zip -r ../iou.bna *
